import React, { useState } from 'react';
import axios from '../api/axios';

const AddStudent = ({ token }) => {
  const [form, setForm] = useState({
    identifier: '',
    name: '',
    age: '',
    classId: '',
    mobileNo: '',
    isVaccinated: false
  });
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);
  const [success, setSuccess] = useState(null);

  const handleChange = (e) => {
    const { name, value, type, checked } = e.target;
    setForm(prev => ({
      ...prev,
      [name]: type === 'checkbox' ? checked : value
    }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setLoading(true);
    setError(null);
    setSuccess(null);

    const payload = {
      identifier: form.identifier,
      name: form.name,
      age: parseInt(form.age, 10),
      classId: parseInt(form.classId, 10),
      mobileNo: form.mobileNo,
      isVaccinated: form.isVaccinated
    };

    try {
      await axios.post(
        '/v1/student/add',
        payload,
        { headers: { Authorization: `Bearer ${token}` } }
      );
      setSuccess('Student added successfully.');
      setForm({ identifier: '', name: '', age: '', classId: '', mobileNo: '', isVaccinated: false });
    } catch (err) {
      setError(err.response?.data || 'Failed to add student.');
    } finally {
      setLoading(false);
    }
  };

  const styles = {
    container: { maxWidth: '500px', margin: '2rem auto', padding: '1.5rem', border: '1px solid #ddd', borderRadius: '8px', backgroundColor: '#fafafa' },
    field: { marginBottom: '1rem' },
    label: { display: 'block', marginBottom: '0.5rem', fontWeight: '500' },
    input: { width: '100%', padding: '0.5rem', border: '1px solid #ccc', borderRadius: '4px' },
    checkbox: { marginRight: '0.5rem' },
    button: { padding: '0.75rem 1.5rem', backgroundColor: '#007bff', color: 'white', border: 'none', borderRadius: '4px', cursor: 'pointer' },
    messageError: { color: '#f44336', marginBottom: '1rem' },
    messageSuccess: { color: '#4caf50', marginBottom: '1rem' }
  };

  return (
    <div style={styles.container}>
      <h2 style={{ textAlign: 'center', marginBottom: '1.5rem' }}>Add / Manage Student</h2>
      <form onSubmit={handleSubmit}>
        <div style={styles.field}>
          <label style={styles.label}>Identifier</label>
          <input
            type="text"
            name="identifier"
            value={form.identifier}
            onChange={handleChange}
            required
            style={styles.input}
          />
        </div>
        <div style={styles.field}>
          <label style={styles.label}>Name</label>
          <input
            type="text"
            name="name"
            value={form.name}
            onChange={handleChange}
            required
            style={styles.input}
          />
        </div>
        <div style={styles.field}>
          <label style={styles.label}>Age</label>
          <input
            type="number"
            name="age"
            value={form.age}
            onChange={handleChange}
            required
            style={styles.input}
          />
        </div>
        <div style={styles.field}>
          <label style={styles.label}>Class ID</label>
          <input
            type="number"
            name="classId"
            value={form.classId}
            onChange={handleChange}
            required
            style={styles.input}
          />
        </div>
        <div style={styles.field}>
          <label style={styles.label}>Mobile No</label>
          <input
            type="text"
            name="mobileNo"
            value={form.mobileNo}
            onChange={handleChange}
            required
            style={styles.input}
          />
        </div>
        <div style={styles.field}>
          <label style={styles.label}>
            <input
              type="checkbox"
              name="isVaccinated"
              checked={form.isVaccinated}
              onChange={handleChange}
              style={styles.checkbox}
            />Vaccinated
          </label>
        </div>
        {error && <div style={styles.messageError}>{error}</div>}
        {success && <div style={styles.messageSuccess}>{success}</div>}
        <button type="submit" disabled={loading} style={styles.button}>
          {loading ? 'Adding...' : 'Add Student'}
        </button>
      </form>
    </div>
  );
};

export default AddStudent;
